// Form Submission Processor
// Validates, enriches, and routes form submissions

const submission = $input.first().json;

// Validate submission
const errors = [];
if (!submission.email || !submission.email.includes('@')) {
  errors.push('Invalid email address');
}

if (errors.length > 0) {
  return [{
    json: {
      success: false,
      errors,
      submission
    }
  }];
}

// Process submission
const processedSubmission = {
  id: `sub-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
  timestamp: new Date().toISOString(),

  // Form data
  data: {
    email: submission.email?.toLowerCase(),
    firstName: submission.firstName || submission.first_name || '',
    lastName: submission.lastName || submission.last_name || '',
    company: submission.company || '',
    phone: submission.phone || '',
    ...submission
  },

  // Source tracking
  source: {
    page: submission._page || submission.page,
    utm_source: submission.utm_source || '',
    utm_medium: submission.utm_medium || '',
    utm_campaign: submission.utm_campaign || '',
    referrer: submission._referrer || '',
    landingPage: submission._landingPage || ''
  },

  // Device info
  device: {
    userAgent: submission._userAgent || '',
    screenSize: submission._screenSize || '',
    isMobile: submission._isMobile || false
  },

  // Scoring
  leadScore: calculateLeadScore(submission),

  // Routing
  assignedTo: null,
  workflow: determineWorkflow(submission)
};

function calculateLeadScore(data) {
  let score = 0;

  // Company provided
  if (data.company) score += 20;

  // Phone provided
  if (data.phone) score += 15;

  // Business email (not gmail, yahoo, etc)
  const personalDomains = ['gmail.com', 'yahoo.com', 'hotmail.com', 'outlook.com'];
  const emailDomain = data.email?.split('@')[1]?.toLowerCase();
  if (emailDomain && !personalDomains.includes(emailDomain)) score += 25;

  // UTM campaign present (targeted traffic)
  if (data.utm_campaign) score += 10;

  // Time spent (if tracked)
  if (data._timeOnPage > 60) score += 10;
  if (data._timeOnPage > 180) score += 10;

  return Math.min(100, score);
}

function determineWorkflow(data) {
  // High-intent indicators
  if (data.demo_request || data.pricing_interest) {
    return 'sales_qualified';
  }

  // Lead score based routing
  const score = calculateLeadScore(data);
  if (score >= 60) return 'marketing_qualified';
  if (score >= 30) return 'nurture_sequence';
  return 'general_newsletter';
}

return [{ json: processedSubmission }];

