// CRO Analytics Processor
// Analyzes landing page performance and identifies optimization opportunities

const analyticsData = $input.first().json;

// Process funnel data
const funnelAnalysis = {
  steps: [],
  dropoffs: [],
  overallConversion: 0
};

if (analyticsData.results) {
  const steps = analyticsData.results[0]?.result || [];
  let previousCount = null;

  steps.forEach((step, index) => {
    const count = step.count || 0;
    const dropoff = previousCount ? ((previousCount - count) / previousCount * 100) : 0;

    funnelAnalysis.steps.push({
      name: step.name || `Step ${index + 1}`,
      count,
      conversionRate: previousCount ? ((count / previousCount) * 100).toFixed(2) : 100,
      dropoff: dropoff.toFixed(2)
    });

    if (dropoff > 20) {
      funnelAnalysis.dropoffs.push({
        step: step.name || `Step ${index + 1}`,
        dropoffRate: dropoff.toFixed(2),
        severity: dropoff > 50 ? 'critical' : dropoff > 35 ? 'high' : 'medium'
      });
    }

    previousCount = count;
  });

  // Overall conversion
  if (steps.length > 0) {
    const first = steps[0]?.count || 0;
    const last = steps[steps.length - 1]?.count || 0;
    funnelAnalysis.overallConversion = first > 0 ? ((last / first) * 100).toFixed(2) : 0;
  }
}

// Generate recommendations
const recommendations = [];

funnelAnalysis.dropoffs.forEach(dropoff => {
  if (dropoff.severity === 'critical') {
    recommendations.push({
      priority: 'high',
      step: dropoff.step,
      issue: `Critical dropoff of ${dropoff.dropoffRate}%`,
      suggestions: [
        'Simplify this step',
        'Add progress indicator',
        'Reduce form fields',
        'Add trust signals'
      ]
    });
  }
});

return [{
  json: {
    funnelAnalysis,
    recommendations,
    period: '7 days',
    analyzedAt: new Date().toISOString()
  }
}];

